const BlogList = ({ spots, title}) => {
    // const blogs = props.blogs;
    // const title = props.title;
    // console.log(blogs);

    return (
      <div className="surf-spot">
        <h2>{ title }</h2>
        {spots.map(spot => (
          <div className="spot-preview" key={spot.id} >
            <h2>{ spot.title }</h2>
            <p>Location { spot.l }</p>
          </div>
        ))}
      </div>
    );
  }

  export default BlogList;
